window.bookSummaryJSON = "<p>As a powerful Guardian, Gregoire has spent centuries fighting for the safety and security of all the Realms. His existence was one long bloody battle until his mate was born. For over two decades since her birth, he’s watched over her, protecting his innocent mate from the dangers of his world. Ensuring she has time to grow before he claims her.<br> <br> Alyssa has done everything her family has expected of her, until the day she learns she has a mate. A mate who kept their bond a secret. Having always been treated as weak and inferior by her own kind, she feels the full brunt of his rejection. Angry and hurt at being left in the dark, innocent and unclaimed, she decides it’s time to assert her independence.<br> <br> Can Alyssa maintain her sense of self while surrendering to Gregoire's savage passion? Or will his enemies intervene and destroy their chance at an eternal bond?\"</p>"; 
